import React from 'react'

function Suggestion(props) {
    
const suggestion = props.results.map((data,index)=>{
  return <div className='emp-data'> 
             <span>{data.name}</span>
        </div>
})

  return (
    <div>Suggestion</div>
  )
}

export default Suggestion
